import { useEffect, useState } from "react";

const PRIORITY_COLORS = {
  Critical: "border-red-600 bg-red-100",
  High: "border-orange-500 bg-orange-100",
  Medium: "border-yellow-400 bg-yellow-100",
  Low: "border-green-400 bg-green-100",
};

export default function Dashboard() {
  const [tickets, setTickets] = useState([]);
  const [visibleCount, setVisibleCount] = useState(10);
  const [expandedTickets, setExpandedTickets] = useState([]);

  useEffect(() => {
    fetch("http://localhost/tickets-api/tickets_latest.php")
      .then((res) => res.json())
      .then((data) => {
        const openTickets = data.filter(ticket => ticket.status !== 'Resolved' && ticket.status !== 'Closed');
        setTickets(openTickets);
      })
      .catch((err) => console.error("Eroare la fetch:", err));
  }, []);

  const toggleExpand = (id) => {
    setExpandedTickets((prev) =>
      prev.includes(id) ? prev.filter((ticketId) => ticketId !== id) : [...prev, id]
    );
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-gray-100 to-gray-300 p-8">
      <h1 className="text-5xl font-extrabold mb-10 text-center text-gray-800">Tickete Deschise</h1>
      <div className="flex flex-col gap-6 items-center">
        {tickets.slice(0, visibleCount).map((ticket) => (
          <div
            key={ticket.id}
            className={`w-full max-w-4xl rounded-3xl shadow-lg p-6 border-l-8 ${PRIORITY_COLORS[ticket.priority_name] || "border-gray-300 bg-white"}`}
          >
            <div className="flex justify-between items-start">
              <div>
                <h2 className="text-xl font-bold text-gray-900 mb-2">{ticket.incident_title}</h2>
                <p className="text-sm text-gray-800"><span className="font-semibold">Prioritate:</span> {ticket.priority_name}</p>
                <p className="text-sm text-gray-800"><span className="font-semibold">Status:</span> {ticket.status}</p>
                <p className="text-sm text-gray-800"><span className="font-semibold">Creat de:</span> {ticket.created_by}</p>
                <p className="text-sm text-gray-800"><span className="font-semibold">Start:</span> {ticket.start_date?.split("T")[0]}</p>
              </div>
              <button
                onClick={() => toggleExpand(ticket.id)}
                className="bg-blue-500 text-white text-xs px-3 py-1 rounded-full hover:bg-blue-600 transition-colors"
              >
                {expandedTickets.includes(ticket.id) ? "Ascunde" : "Detalii"}
              </button>
            </div>

            {expandedTickets.includes(ticket.id) && (
              <div className="mt-4 border-t pt-4">
                <p className="text-gray-700 text-sm mb-1"><span className="font-semibold">Persoană asignată:</span> {ticket.assigned_person || "-"}</p>
                <p className="text-gray-700 text-sm mb-1"><span className="font-semibold">Echipă:</span> {ticket.team_assigned_person || "-"}</p>
                <p className="text-gray-700 text-sm mb-1"><span className="font-semibold">Proiect:</span> {ticket.project || "-"}</p>
                <p className="text-gray-700 text-sm mb-1"><span className="font-semibold">Comentariu:</span> {ticket.comment || "-"}</p>
                <p className="text-gray-700 text-sm mb-1"><span className="font-semibold">Rezolvare:</span> {ticket.resolution || "-"}</p>
                <p className="text-gray-700 text-sm"><span className="font-semibold">Închis la:</span> {ticket.closed_date ? ticket.closed_date.split("T")[0] : "-"}</p>
              </div>
            )}
          </div>
        ))}

        {visibleCount < tickets.length && (
          <button
            onClick={() => setVisibleCount(visibleCount + 10)}
            className="mt-6 px-6 py-2 bg-indigo-600 text-white font-semibold rounded-full hover:bg-indigo-700 transition-all"
          >
            Încarcă mai multe
          </button>
        )}
      </div>
    </div>
  );
}
